import React, { Component } from "react";
import Header from "../../Components/Header";
import Axios from "axios";
import DrugModal from "../../Components/DrugModal";
import AvailableDrugModal from "../../Components/AvailableDrugModal";
import { withRouter } from "react-router";
import GetAuthorisation from '../../Funciton/GetAuthorisation';
import { Redirect } from "react-router-dom";
import ModalDialog from "../../Components/ModalDialog";
import PrescriptionDrug from "../../Components/PrescriptionDrug";

class Report extends Component {
	state = {
		id: "",
		email: "",
		password: "",
		name: "",
		surname: "",
		address: "",
		phoneNumber: "",
		appointments: [],
		redirect: false,
		redirectUrl: '',
		openModalSuccess: false,
		patientsHistory: false,
	};

render() {

    if (this.state.redirect) return <Redirect push to={this.state.redirectUrl} />;

    return (
        <React.Fragment>
            <Header />

            <div className="container" style={{ marginTop: "-5%" }}>
                <h1 className="table" style={{ width: "100%", marginTop: "5em", marginLeft: "9.5em",marginRight: "auto" }}>PATIENTS</h1>
                <div className="col-lg-8 mx-auto">
            </div>
            
            </div>

            </React.Fragment>);
    
}
}
export default withRouter(Report);
